import React, { useRef, useState } from 'react';
import MovingObject from './MovingObject';

const MovingObjectsTest = () => {
  const [yValues, setYValues] = useState(Array(5).fill(0));

  const handleYChange = (index, value) => {
    const newYValues = [...yValues];
    newYValues[index] = value;
    setYValues(newYValues);
  };

  return (
    <div>
      {yValues.map((y, index) => (
        <div key={index}>
          <input
            type="number"
            value={y}
            onChange={(e) => handleYChange(index, e.target.value)}
          />
          <MovingObject y={y} />
        </div>
      ))}
    </div>
  );
};

export default MovingObjectsTest ;
